import React from "react";
import { FcLike } from "react-icons/fc";

const Card = ({ data }) => {
  return (
    <div>
      <div>
        <img src={data.image.url} alt="Imgae" />
        <div>
          <button>
            <FcLike fontSize="1.75rem" />
          </button>
        </div>
        <div>
          <p>{data.title}</p>
          <p>{data.description}</p>
        </div>
      </div>
    </div>
  );
};

export default Card;
